import React, { useState, component } from 'react';
import { action } from '@storybook/addon-actions';
import { BrowserRouter } from 'react-router-dom'
import Checkbox from '@material-ui/core/Checkbox';
import CustomCheckBox from '../components/Icons/customCheckbox';
import CheckboxChecked from '../components/Icons/checkboxChecked';
import IntermediateCheckbox from '../components/Icons/intermediateCheckbox'
import { styles, listItemTextStyles, CheckBoxWrapper } from '../components/CheckboxGroup/styles';
import PropTypes from 'prop-types';


export default {
  title: 'Checkbox',
  component: Checkbox,
};

export function CheckBoxContainer({
  label,
  show,
  id,
  checboxChange,
  shouldDisable,
  resultCount,
  intermediate,
  multi = false,
  state
}) {

  const classes = styles();
  const disable = shouldDisable

  return (
    <BrowserRouter>
      <h3>Checkboxes</h3>
      <p>
        {/* <h4>Standard</h4> */}
          Standard <Checkbox onClick={action("I've been checked")}/>
        {/* <h4>Custom</h4> */}
          Custom <CustomCheckBox />
        <h4>Intermediate</h4>
          <IntermediateCheckbox />
        <h4>Disabled</h4>   
          {/* <Checkbox disabled={disable} onClick={action("I've been clicked")}/> */}
          {/* <CheckboxChecked disabled={disable} /> */}
          <CustomCheckBox disabled={disable}/>  
      </p>
    </BrowserRouter>
  );
}
